// src/App.js
import React from "react";
import "./App.css";
import Transacciones from "./components/Transactions";
import Asistente from "./components/Assistant";
import Login from "./components/Login"
import Register from "./components/Register"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Finanzas Senior</h1>
      </header>

      <main style={{ padding: "20px" }}>
        <Asistente />
        <hr />
        <Transacciones />
        <Login />
      </main>
    </div>
  );
}

export default App;
